import React from 'react';

const Apreslebut = () => {
  return (
    <div className="ApreslebutContent">
        <div className="textContent">
          <h2>Vers quoi s'orientent les diplômés ?</h2>
          <p>
             Après le BUT, les étudiants auront un grand choix à faire, en effet, diplômés titulaire d'un BAC+3 les préparant à la poursuite d'études en master
             et en école d'ingénieur mais aussi à l'insertion professionnelle.
             <br></br>
             <br></br>
             Comme on peut le voir sur ce diagramme, la majorité des étudiants optait déjà pour continuer leurs études au minimum un an après un DUT (BAC+2) dans 79% des cas
             dont 18% d'entre eux pour seulement un an.
             <br></br>
             <br></br>
             Ces 18% n'auraient pas eu le besoin de continuer une année de plus s'ils avaient eu le DUT en 3 ans.
             <br></br>
             <br></br>
          </p>
          <a href="/" target="_blank" rel="noreferrer" a>Cliquez ici pour être redirigé sur le site de l'IUT de Roanne et avoir plus d'informations</a>
        </div>
    </div>
  );
};

export default Apreslebut;
